            <Route path="/" element={<Login />} />
            <Route path="/Home" element={<Home />} />
            <Route path='/Page2' element={<Page2 />} />
          </Routes> */}
          {
            loginState ?
              <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/home" element={<Home />} />
                <Route path='/Page2' element={<Page2 />} />
                <Route path='*' element={<PageNotFound />} />
              </Routes>
              :
              <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/home" element={<Error />} />
                <Route path='/Page2' element={<Error />} />
                <Route path='*' element={<PageNotFound />} />
              </Routes>
          }
        </Router>
      </div>
      // </EthProvider>
    );
  };
}

